import Papa from 'papaparse';

export const getProducts = () : Promise<String[]> => {
    return fetch("https://julie-commerce.s3.us-west-2.amazonaws.com/moisturizer1_clean.csv")
    .then(response => response.text())
    .then(v => Papa.parse(v)) as Promise<String[]>;
}
